import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <nav className="navbar">
      <h1>FitBud</h1>
      <div classname="links">
        <a href="/">Home</a>
        <a href="/login">Login</a>
      </div>
    </nav>
  );
}
export default NavBar;
